public class Expression{
  public Expression(){
  } //do you need a constructor if it doesn't have any variables? 
  public double evaluate(){
    return Double.NaN;
  }
}





public class Number extends Expression{
  private double value = 0;
  public Number(double val){
    value = val;
  }
  public double evaluate(){
    return this.value;
  }
}





public class BinaryOperator extends Expression{
  public BinaryOperator(){
    firstExpression = new Expression();
    secondExpression = new Expression();
  }
  public getLeft(){
    return firstExpression;
  }
  public getRight(){
    return secondExpression;
  }
}





public class Addition extends Expression{
  //does this need to have private variables for firstNum and secondNum? 
  public Addition(double first, double second){
    firstNum = new Number(first);
    secondNum = new Number(second);
  }
  public double evaluate(){
    return this.firstNum + this.secondNum;
  }
}





public class Multiplication extends Expression{
  public Addition(double first, double second){
    firstNum = new Number(first);
    secondNum = new Number(second);
  }
  public double evaluate(){
    return this.firstNum * this.secondNum;
  }
}





public class LoggingAddition extends Expression{
  public LoggingAddition(double first, double second){
    firstNum = new Number(first);
    secondNum = new Number(second);
  }
  public double evaluate(){
    System.out.println(this.firstNum + " + " + this.secondNum);
    return this.firstNum + this.secondNum;
  }
}
